<?xml version="1.0" encoding="UTF-8"?><head><meta http-equiv="Content-Type" content="text/html;charset=ISO-8859-1"/><title>Hierarchy Structure</title><link rel="stylesheet" type="text/css" href="html2.css"/><script type="text/javascript">
                
                function toggleDisplay(element) {
                if(element.style.display == 'none'){
                element.style.display = 'block';
                } else {
                element.style.display = 'none';
                }                        
                }
                
                function plus2minus(d) {
                if (document.getElementById(d).src.match("html_img/minus.png")){
                document.getElementById(d).src = "html_img/plus.png";
                } else {
                document.getElementById(d).src = "html_img/minus.png";
                }
                }
                
                function print_me()
                {
                var content = document.getElementById('html2').innerHTML;
                var win = window.open();
                win.document.write(content);
                win.print();
                win.close();
                }
